create table admins
(
    id        TEXT
        primary key,
    name      TEXT                 not null,
    api_key   TEXT                 not null
        unique,
    created   INTEGER              not null,
    is_active BOOLEAN default TRUE not null
);

create unique index admins_api_key_key
    on admins (api_key);

create index admins_is_active_idx
    on admins (is_active);


create table providers
(
    id        TEXT                 not null
        primary key,
    name      TEXT                 not null,
    base_url  TEXT                 not null,
    api_key   TEXT                 not null,
    is_active BOOLEAN default true not null
);

create unique index Providers_name_key
    on providers (name);



create table provider_models
(
    id          TEXT                 not null
        primary key,
    provider_id TEXT                 not null
        constraint provider_models_provider_id_fkey
            references providers
            on update cascade on delete restrict,
    model_name  TEXT                 not null,
    prompt      REAL                 not null,
    completion  REAL                 not null,
    image       REAL                 not null,
    request     REAL                 not null,
    is_active   BOOLEAN default true not null
);

create unique index provider_models_model_name_provider_id_key
    on provider_models (model_name, provider_id);


create table public_models
(
    id                                 TEXT                 not null
        primary key,
    public_model_name                  TEXT                 not null,
    name                               TEXT,
    created                            BIGINT               not null,
    description                        TEXT,
    prompt                             REAL                 not null,
    completion                         REAL                 not null,
    image                              REAL,
    architecture_modality              TEXT,
    architecture_tokenizer             TEXT,
    architecture_instruct_type         TEXT,
    context_length                     INTEGER,
    top_provider_context_length        INTEGER,
    top_provider_max_completion_tokens INTEGER,
    top_provider_is_moderated          BOOLEAN,
    is_active                          BOOLEAN default true not null,
    request                            REAL,
    is_show                            BOOLEAN default true not null
);

create unique index public_models_public_model_name_key
    on public_models (public_model_name);


