create table public_model_on_provider_model
(
    id                TEXT not null
        primary key,
    provider_model_id TEXT not null
        constraint public_model_on_provider_model_provider_model_id_fkey
            references provider_models
            on update cascade on delete restrict,
    public_model_id   TEXT not null
        constraint public_model_on_provider_model_public_model_id_fkey
            references public_models
            on update cascade on delete restrict
);

create unique index public_model_on_provider_model_provider_model_id_public_model_id_key
    on public_model_on_provider_model (provider_model_id, public_model_id);



create table users
(
    id        TEXT                 not null
        primary key,
    email     TEXT                 not null,
    created   BIGINT               not null,
    name      TEXT,
    balance   REAL    default 0    not null,
    is_active BOOLEAN default TRUE not null
);

create unique index Users_email_key
    on users (email);


create table user_keys
(
    id      TEXT   not null
        primary key,
    user_id TEXT   not null
        constraint user_keys_user_id_fkey
            references users
            on update cascade on delete restrict,
    api_key TEXT   not null,
    created BIGINT not null,
    title   TEXT
);

create unique index user_keys_api_key_key
    on user_keys (api_key);


create table user_payments
(
    id       TEXT
        primary key,
    user_id  TEXT    not null,
    amount   REAL    not null,
    created  INTEGER not null,
    paid_at  INTEGER not null,
    currency TEXT    not null,
    method   TEXT    not null,
    status   TEXT    not null,
    check (amount > 0),
    check (created > 0),
    check (paid_at > 0)
);

create index idx_user_payments_created
    on user_payments (created);

create index idx_user_payments_status
    on user_payments (status);

create index idx_user_payments_user_id
    on user_payments (user_id);


create table user_token_usage
(
    id                TEXT           not null
        primary key,
    user_id           TEXT           not null
        constraint user_token_usage_user_id_fkey
            references users
            on update cascade on delete restrict,
    user_key_id       TEXT,
    model             TEXT           not null,
    provider          TEXT           not null,
    total_tokens      INTEGER        not null,
    prompt_tokens     INTEGER        not null,
    completion_tokens INTEGER        not null,
    created           BIGINT         not null,
    total_cost        REAL default 0 not null,
    stream            BOOLEAN        not null,
    request_id        TEXT           not null
);

